import React from "react";

export interface User {
  id: number;
  firstName: string;
  lastName: string;
  attribute: string;
  email: string;
  status: string;
  verified?: boolean;
}

interface Props extends User {
  onCellClick: (
    id: number,
    firstName: string,
    lastName: string,
    email: string
  ) => void;
}

const TableRow: React.FC<Props> = ({
  id,
  firstName,
  lastName,
  attribute,
  email,
  status,
  verified,
  onCellClick,
}) => (
  <tr onClick={() => onCellClick(id, firstName, lastName, email)}>
    <td className="py-3.5 pr-4 pl-4 text-left text-neutral-500 font-medium bg-white">
      {id}
    </td>
    <td className="py-3.5 pr-4 pl-4 text-left text-neutral-500 font-medium bg-white">
      {firstName}
    </td>
    <td className="py-3.5 pr-4 pl-4 text-left text-neutral-500 font-medium bg-white">
      {lastName}
    </td>
    <td className="py-3.5 pr-4 pl-4 text-left text-neutral-500 font-medium bg-white">
      {attribute}
    </td>
    <td className="py-3.5 pr-4 pl-4 text-left text-neutral-500 font-medium bg-white">
      {email}
    </td>
    <td className="py-3.5 pr-4 pl-4 text-left font-medium bg-white">
      <span
        className={`px-2.5 py-1 text-sm font-medium ${getStatusStyle(
          status
        )} rounded-full`}
      >
        {status}
      </span>
    </td>
  </tr>
);

export default TableRow;
